#Importamos librerias para cargar y manejar el DataSet
import pandas as pd
import numpy as np

#Importamos DataSet
data = pd.read_csv('/content/KaggleV2-May-2016.csv')
data.head(3)

#Primer vistazo a los datos.
data.describe()

"""### **Ajuste de datos**"""

#Ajuste de los datos, columna con fechas. Calculo del tiempo de espera antes de 
#ser atendido en una nueva columna "waiting".
data_dia = pd.to_datetime(data.AppointmentDay)
agen_dia =  pd.to_datetime(data.ScheduledDay)
espera = data_dia - agen_dia
data['waiting'] = pd.DataFrame(espera)
data = data[data.waiting >= '0']

data.head(2)

#Agregamos el numero de dias de la semana
data['weekday'] = data_dia.dt.weekday

#Convertimos de la columna de espera, a un valor entero con el unico valor 
#de dias de espera
data['waiting'] =(data.waiting/np.timedelta64(1, 'D')).astype(int)

data.sample(3)

#Convertimos la columna No-show en valores binarios
data.rename(columns={'No-show': 'Show'},inplace=True)
data['Show'] = data.Show.transform(lambda x: 1 if (x == 'No') else 0)

#Calculo para saber el porcentaje de asistencias sobre todas las citas realizadas.
data['cant_asistencias'] = data.groupby('PatientId')[['Show']].transform(sum)
data['cant_turnos'] = data.groupby('PatientId')[['Show']].transform('count')
data['prom_asistencia'] = data.cant_asistencias / data.cant_turnos

