#Importo las librerias necesarias para graficar
from sklearn.metrics import confusion_matrix
from sklearn.metrics import classification_report
import seaborn as sns
import matplotlib.pyplot as plt
#Defino una funcion para graficar los resultados
def mostrar_resultados(y_test, y_pred):
  #Defino la matriz de confusión con los resultados de prueba y predichos
  matrix = confusion_matrix(y_test, y_pred)
  #Asigno la escala de la figura
  plt.figure(figsize=(12, 12))
  #Asigno un mapa de calor a la figura
  sns.heatmap(matrix, annot=True, fmt="d")
  #Defino los labels de la grafica
  plt.title("Confusion matrix")
  plt.ylabel('True class')
  plt.xlabel('Predicted class')
  plt.show()
  print (classification_report(y_test, y_pred))

